INSERT INTO `policy` VALUES (1,'Hello and welcome  yet MDC Project','<p>Respect for your privacy is coded into our Company. Since we started MDC, we’ve aspired to build our Services with a set of strong privacy principles in mind.</p><p><span style=\"font-weight: bolder;\"><u><span style=\"font-family: &quot;Arial Black&quot;;\">Information that is easier to understand</span></u></span></p><p>Our updated Terms and Privacy Policy are easier to understand and reflect new features.</p><p><span style=\"font-weight: bolder;\"><u><span style=\"font-family: &quot;Arial Black&quot;;\">Your data are yours, and we can’t read them</span></u></span></p><p>We’ve built privacy, end-to-end encryption, and other security features into MDC.&nbsp;<span style=\"font-size: 1rem;\">We don’t store your messages once they’ve been delivered. When they are end-to-end encrypted, we and third parties can’t read them.</span></p><p><span style=\"font-size: 1rem;\"><u><span style=\"font-weight: bolder;\"><span style=\"font-family: &quot;Arial Black&quot;;\">The choices you have</span></span></u></span></p><p><span style=\"font-size: 1rem;\">If you are an existing user, you can choose not to have your account information shared with MDC to improve your product experiences.</span></p><p><span style=\"font-size: 1rem;\"><span style=\"font-weight: bolder;\"><u><span style=\"font-family: &quot;Arial Black&quot;;\">Changes in the PRIVACY POLICY</span></u></span></span></p><p><span style=\"font-size: 1rem;\">We reserve the right to amend our privacy/security policy and make the new provisions effective for all information we maintain from time to time. The revised policy will be posted in our facilities and offices and will be available while obtaining the treatment from our hospital directly. Your use of our website shall comprise of acceptance of any changes of this Privacy and Security Policy.</span></p><p><span style=\"font-weight: bolder;\"><u><span style=\"font-family: &quot;Arial Black&quot;;\">Camera&nbsp;access&nbsp;</span></u></span></p><p><span style=\"font-family: Arial;\">﻿</span><font face=\"Arial\">MDC would like to access your camera for accessing and showing your profile picture in the APP.</font></p><p><font face=\"Arial\">MDC would like to access your gallery for accessing and showing your profile picture in the APP.</font></p><p><font face=\"Arial\"><br></font></p><p><span style=\"color: rgb(51, 51, 51); font-family: nunito_sansregular; font-size: 14px; letter-spacing: 0.3px;\"><span style=\"font-family: &quot;Arial Black&quot;;\"><span style=\"font-weight: bolder;\"><u>We use the information for</u></span></span></span></p><p><font color=\"#333333\" face=\"Arial\"><span style=\"font-size: 14px; letter-spacing: 0.3px;\">security, safety, and due diligence purposes. For example, we may use personal information to protect our company, customers, and business partners, and&nbsp;</span></font><span style=\"font-family: Arial; font-size: 14px; letter-spacing: 0.3px; color: rgb(51, 51, 51);\">their respective personnel. We may also use personal information to protect our websites&nbsp;</span><span style=\"font-family: Arial; font-size: 14px; letter-spacing: 0.3px; color: rgb(51, 51, 51);\">or our services, prevent abuse, as well as to detect and investigate activities that may be&nbsp;</span><span style=\"font-family: Arial; font-size: 14px; letter-spacing: 0.3px; color: rgb(51, 51, 51);\">illegal or prohibited (such as cyberattacks or fraudulent transactions). We may also use&nbsp;</span><span style=\"font-family: Arial; font-size: 14px; letter-spacing: 0.3px; color: rgb(51, 51, 51);\">the information to conduct background, employment, and credit checks and to assess&nbsp;</span><span style=\"font-family: Arial; font-size: 14px; letter-spacing: 0.3px; color: rgb(51, 51, 51);\">financial, reputational, credit, and other risks arising from any relationship or prospective&nbsp;</span><span style=\"font-family: Arial; font-size: 14px; letter-spacing: 0.3px; color: rgb(51, 51, 51);\">relationship with you.</span></p>','2020-12-16 13:33:00','2021-01-19 13:08:30');
